import React from 'react'
// import PropTypes from 'prop-types'
import './style.css';
import img1 from '../images/img1.jpg';

const ItemList = props => {
  return (
    <div className='itemBlock'>
      <img src={img1} alt="img" />
    </div>
  )
}

ItemList.propTypes = {

}

export default ItemList
